  (fn print_n (n int)
    ((let cur 100000000)
    (let base 10)
    (let zero 48)
    (if (= n 0)
      (print_str "0")
      ((while (= 0 (% (/ n cur) base)) (
          (set cur (/ cur base)) ))
        (while cur (
