    (let i 0)
    (while (< i (. 'arr len)) (
      (if i (print_str ", ") ())
      (print_n (* (get arr i)))
      (set i (+ i 1))
      ()
    ))
    (print_str "]\n")))

  (fn fill (arr ints)
