    (while (< i (. 'arr len)) (
      (pset (get arr i) (% (* (+ i 666) 666342123) 100))
      (set i (+ i 1))
      ()))))


  (fn sum (arr ints) int
    ((let i 0)
    (let s 0)
    (while (< i 30)
      ((let j 0)
      (while (< j 30) (
        (set s (+ s (* (+ (. 'arr ptr) (* 8 (+ (* j 30) i))))))
        (set j (+ j 1))
        ()))
      (set i (+ i 1))
      ()))
    s))

  (fill arr)
  (print_ints arr)
  (print_n (sum arr))
